anguageCode\":\"xh\",\"languageName\":{\"simpleText\":\"Xhosa\"}},{\"languageCode\":\"yi\",\"languageName\":{\"simpleText\":\"Yiddish\"}},{\"languageCode\":\"yo\",\"languageName\":{\"simpleText\":\"Yoruba\"}},{\"languageCode\":\"zu\",\"languageName\":{\"simpleText\":\"Zulu\"}}],\"defaultAudioTrackIndex\":0,\"contribute\":{\"captionsMetadataRenderer\":{\"addSubtitlesText\":{\"runs\":[{\"text\":\"Add subtitles\/CC\",\"navigationEndpoint\":{\"clickTrackingParams\":\"CAAQu2kiEwiwyYeA35LqAhVYh1UKHRGzB0Q=\",\"commandMetadata\":{\"webCommandMetadata\":{\"url\":\"\/timedtext_video?ref=watch\\u0026v=_AvNT3vyzr0\",\"rootVe\":83769}},\"urlEndpoint\":{\"url\":\"\/timedtext_video?ref=watch\\u0026v=_AvNT3vyzr0\"}}}]},\"noSubtitlesText\":{\"simpleText\":\"This video doesn't have subtitles or closed captions yet.\"},\"promoSubtitlesText\":{\"simpleText\":\"Help this video reach more people by contributing subtitles or closed captions in a language you speak.\"}}}}},\"videoDetails\":{\"videoId\":\"_AvNT3vyzr0\",\"title\":\"Why China Will Not Become the Dominant Power in Asia\",\"lengthSeconds\":\"4280\",\"keywords\":[\"ANU\",\"The ANU\",\"Education\",\"Australia\",\"Research\",\"Policy\",\"Academic\",\"University\",\"The Australian National University\",\"China (Country)\",\"asian economic development\",\"military spending\",\"regional security\",\"John Lee\",\"Paul Dibb\",\"Strategic \\u0026 Defence Studies Centre\",\"China's weakness\",\"People’s Liberation Army\",\"PLA\",\"china vs US\",\"Incomplete Superpower\",\"Defence White Paper\"],\"channelId\":\"UCxzvNYT-17mjYJMuDzGx7AA\",\"isOwnerViewing\":false,\"shortDescription\":\"Public Lecture by Emeritus Professor Paul Dibb and Adjunct Associate Professor John Lee.\\n\\nThe belief that China will soon become the dominant power in Asia is based on assumptions that its continued and rapid economic rise, and its emergence as a regional peer of America’s in military terms is all but assured. Such a belief underpins arguments that a fundamental strategic reorganisation of Asia is inevitable, and that it will be necessary and perhaps even desirable to concede to China significant ‘strategic space’. Dependent largely on linear extrapolations about the future, such arguments ignore the implications of China’s economic, social and national fragilities, its lack of major friends or allies in the region as well as the considerable military deficiencies and challenges faced by the People’s Liberation Army. With the Defence White Paper due for release in 2015, the government should bear in mind that planning for an era of Chinese dominance in the region—or even its emergence as an American strategic peer in Asia—would be premature if not improbable. Australia should not design its defence force for war with China, but it should be able to counter Chinese coercion and contribute to Allied military operations if necessary.\\n\\nPaul Dibb is Emeritus Professor of Strategic Studies in the Strategic \\u0026 Defence Studies Centre, Coral Bell schol of Asia-Pacific Affairs, ANU. He was head of the Strategic and Defence Studies Centre from 1991 to 2004. Before that he held the positions of deputy secretary for Defence, director of the Joint Intelligence Organisation and head of the National Assessments Staff. He studied the former Soviet Union for over 20 years both as a senior intelligence officer and academic. He advised ASIO on certain Soviet activities. His book The Soviet Union--the Incomplete Superpower was published by the International Institute for Strategic Studies , London in 1986, reprinted 1987 and second edition 1988.\\n\\nJohn Lee is an Australian academic working on international economic and security affairs with a focus on the Asia-Pacific. Lee is an adjunct associate professor at the Australian National University's Strategic and Defence Studies Centre, a Michael Hintze Fellow at the Centre for International Security Studies, University of Sydney and a senior scholar at the Hudson Institute in Washington, DC. Lee is a board member of the Institute for Regional Security.\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/_AvNT3vyzr0\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLDjVRYrDEoXvuPzHs3611Y2jZr1gA\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/_AvNT3vyzr0\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLBiluJk7wKjeB8fZ7YqSaQpFKUhKg\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/_AvNT3vyzr0\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLDfSjOVJ2AHQl5lqUAtNqhjm4Q8LA\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/_AvNT3vyzr0\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLBx5p61RwfYjR94Wm4Go245DhK_AQ\",\"width\":336,\"height\":188}]},\"averageRating\":4.1741481,\"allowRatings\":true,\"viewCount\":\"815847\",\"author\":\"ANU TV\",\"isPrivate\":false,\"isUnpluggedCorpus\":false,\"isLiveContent\":false},\"annotations\":[{\"playerAnnotationsExpandedRenderer\":{\"featuredChannel\":{\"startTimeMs\":\"5000\",\"endTimeMs\":\"4280000\",\"watermark\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/an\/xzvNYT-17mjYJMuDzGx7AA\/featured_channel.jpg?v=562eb2bb\",\"width\":40,\"height\":40}]},\"trackingParams\":\"CBoQ8zciEwiwyYeA35LqAhVYh1UKHRGzB0Q=\",\"navigationEndpoint\":{\"clickTrackingParams\":\"CBoQ8zciEwiwyYeA35LqAhVYh1UKHRGzB0QyAml2\",\"commandMetadata\":{\"webCommandMetadata\":{\"url\":\"\/channel\/UCxzvNYT-17mjYJMuDzGx7AA\",\"webPageType\":\"WEB_PAGE_TYPE_BROWSE\",\"rootVe\":3611}},\"browseEndpoint\":{\"browseId\":\"UCxzvNYT-17mjYJMuDzGx7AA\"}},\"channelName\":\"ANU TV\",\"subscribeButton\":{\"subscribeButtonRenderer\":{\"buttonText\":{\"runs\":[{\"text\":\"SUBSCRIBE\"}]},\"subscribed\":false,\"enabled\":true,\"type\":\"FREE\",\"channelId\":\"UCxzvNYT-17mjYJMuDzGx7AA\",\"sho arguments that a fundamental strategic reorganisation of Asia is inevitable, and that it will be necessary and perhaps even desirable to concede to China significant ‘strategic space’. Dependent largely on linear extrapolations about the future, such arguments ignore the implications of China’s economic, social and national fragilities, its lack of major friends or allies in the region as well as the considerable military deficiencies and challenges faced by the People’s Liberation Army. With the Defence White Paper due for release in 2015, the government should bear in mind that planning for an era of Chinese dominance in the region—or even its emergence as an American strategic peer in Asia—would be premature if not improbable. Australia should not design its defence force for war with China, but it should be able to counter Chinese coercion and contribute to Allied military operations if necessary.\\n\\nPaul Dibb is Emeritus Professor of Strategic Studies in the Strategic \\u0026 Defence Studies Centre, Coral Bell schol of Asia-Pacific Affairs, ANU. He was head of the Strategic and Defence Studies Centre from 1991 to 2004. Before that he held the positions of deputy secretary for Defence, director of the Joint Intelligence Organisation and head of the National Assessments Staff. He studied the former Soviet Union for over 20 years both as a senior intelligence officer and academic. He advised ASIO on certain Soviet activities. His book The Soviet Union--the Incomplete Superpower was published by the International Institute for Strategic Studies , London in 1986, reprinted 1987 and second edition 1988.\\n\\nJohn Lee is an Australian academic working on international economic and security affairs with a focus on the Asia-Pacific. Lee is an adjunct associate professor at the Australian National University's Strategic and Defence Studies Centre, a Michael Hintze Fellow at the Centre for International Security Studies, University of Sydney and a senior scholar at the Hudson Institute in Washington, DC. Lee is a board member of the Institute for Regional Security.\"},\"lengthSeconds\":\"4280\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/ANUchannel\",\"externalChannelId\":\"UCxzvNYT-17mjYJMuDzGx7AA\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GU\",\"GW\",\"GY\",\"HK\",\"HM\",\"HN\",\"HR\",\"HT\",\"HU\",\"ID\",\"IE\",\"IL\",\"IM\",\"IN\",\"IO\",\"IQ\",\"IR\",\"IS\",\"IT\",\"JE\",\"JM\",\"JO\",\"JP\",\"KE\",\"KG\",\"KH\",\"KI\",\"KM\",\"KN\",\"KP\",\"KR\",\"KW\",\"KY\",\"KZ\",\"LA\",\"LB\",\"LC\",\"LI\",\"LK\",\"LR\",\"LS\",\"LT\",\"LU\",\"LV\",\"LY\",\"MA\",\"MC\",\"MD\",\"ME\",\"MF\",\"MG\",\"MH\",\"MK\",\"ML\",\"MM\",\"MN\",\"MO\",\"MP\",\"MQ\",\"MR\",\"MS\",\"MT\",\"MU\",\"MV\",\"MW\",\"MX\",\"MY\",\"MZ\",\"NA\",\"NC\",\"NE\",\"NF\",\"NG\",\"NI\",\"NL\",\"NO\",\"NP\",\"NR\",\"NU\",\"NZ\",\"OM\",\"PA\",\"PE\",\"PF\",\"PG\",\"PH\",\"PK\",\"PL\",\"PM\",\"PN\",\"PR\",\"PS\",\"PT\",\"PW\",\"PY\",\"QA\",\"RE\",\"RO\",\"RS\",\"RU\",\"RW\",\"SA\",\"SB\",\"SC\",\"SD\",\"SE\",\"SG\",\"SH\",\"SI\",\"SJ\",\"SK\",\"SL\",\"SM\",\"SN\",\"SO\",\"SR\",\"SS\",\"ST\",\"SV\",\"SX\",\"SY\",\"SZ\",\"TC\",\"TD\",\"TF\",\"TG\",\"TH\",\"TJ\",\"TK\",\"TL\",\"TM\",\"TN\",\"TO\",\"TR\",\"TT\",\"TV\",\"TW\",\"TZ\",\"UA\",\"UG\",\"UM\",\"US\",\"UY\",\"UZ\",\"VA\",\"VC\",\"VE\",\"VG\",\"VI\",\"VN\",\"VU\",\"WF\",\"WS\", litary terms is all but assured. Such a belief underpins arguments that a fundamental strategic reorganisation of Asia is inevitable, and that it will be necessary and perhaps even desirable to concede to China significant ‘strategic space’. Dependent largely on linear extrapolations about the future, such arguments ignore the implications of China’s economic, social and national fragilities, its lack of major friends or allies in the region as well as the considerable military deficiencies and challenges faced by the People’s Liberation Army. With the Defence White Paper due for release in 2015, the government should bear in mind that planning for an era of Chinese dominance in the region—or even its emergence as an American strategic peer in Asia—would be premature if not improbable. Australia should not design its defence force for war with China, but it should be able to counter Chinese coercion and contribute to Allied military operations if necessary.\n\nPaul Dibb is Emeritus Professor of Strategic Studies in the Strategic \u0026 Defence Studies Centre, Coral Bell schol of Asia-Pacific Affairs, ANU. He was head of the Strategic and Defence Studies Centre from 1991 to 2004. Before that he held the positions of deputy secretary for Defence, director of the Joint Intelligence Organisation and head of the National Assessments Staff. He studied the former Soviet Union for over 20 years both as a senior intelligence officer and academic. He advised ASIO on certain Soviet activities. His book The Soviet Union--the Incomplete Superpower was published by the International Institute for Strategic Studies , London in 1986, reprinted 1987 and second edition 1988.\n\nJohn Lee is an Australian academic working on international economic and security affairs with a focus on the Asia-Pacific. Lee is an adjunct associate professor at the Australian National University's Strategic and Defence Studies Centre, a Michael Hintze Fellow at the Centre for International Security Studies, University of Sydney and a senior scholar at the Hudson Institute in Washington, DC. Lee is a board member of the Institute for Regional Security."}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CJMBEJsrIhMI6cKHgN-S6gIVF_5VCh10nQEY","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAndButtonRenderer":{"title":{"simpleText":"Want to subscribe to this channel?"},"content":{"simpleText":"Sign in to subscribe to this channel."},"button":{"buttonRenderer":{"style":"STYLE_BLUE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Sign in"},"navigationEndpoint":{"clickTrackingParams":"CJQBEP2GBCITCOnCh4DfkuoCFRf-VQoddJ0BGDIJc3Vic2NyaWJl","commandMetadata":{"webCommandMetadata":{"url":"https://accounts.google.com/ServiceLogin?service=youtube\u0026uilel=3\u0026passive=true\u0026continue=https%3A%2F%2Fwww.youtube.com%2Fsignin%3Faction_handle_signin%3Dtrue%26app%3Ddesktop%26hl%3Den%26next%3D%252Fwatch%253Fv%253D_AvNT3vyzr0%26continue_action%3DQUFFLUhqay1VN1Z2ZGZYb29ldFUyNDhqQ0xyNE5HNFZVUXxBQ3Jtc0tuaEVYbU85bHNrQVNZOGpGUnFaaW8yTndwNG10c2pwQnFJUHotLTNKNGFRVkRKRzZkZm1aS2dGd09nWmRsSDN3T3BoWmUwNGJES3k3RXJpZUc1WlRqWU16SG5ydDZ4WW01eC1jMEVMNVFZZDFWX3FwQ1hsOWdhZlJUdGdfOEpramgxVUxQSTY1NEtMX255b0taa2V3eGl4dHB0b2s3a3VWS2l6RzV1MG5wMURpeGxVLWxVNHBBN0E1bGRwRzNfNFVUVHFxTmxuNG1rcXNycXN6RnZYNjdKX0g0cFJn\u0026hl=en\u0026ec=66429","rootVe":83769}},"signInEndpoint":{"nextEndpoint":{"clickTrackingParams":"CJQBEP2GBCITCOnCh4DfkuoCFRf-VQoddJ0BGA==","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=_AvNT3vyzr0","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"_AvNT3vyzr0"}},"continueAction":"QUFFLUhqay1VN1Z2ZGZYb29ldFUyNDhqQ0xyNE5HNFZVUXxBQ3Jtc0tuaEVYbU85bHNrQVNZOGpGUnFaaW8yTndwNG10c2pwQnFJUHotLTNKNGFRVkRKRzZkZm1aS2dGd09nWmRsSDN3T3BoWmUwNGJES3k3RX s video doesn't have subtitles or closed captions yet."},"promoSubtitlesText":{"simpleText":"Help this video reach more people by contributing subtitles or closed captions in a language you speak."}}}}},"videoDetails":{"videoId":"_AvNT3vyzr0","title":"Why China Will Not Become the Dominant Power in Asia","lengthSeconds":"4280","keywords":["ANU","The ANU","Education","Australia","Research","Policy","Academic","University","The Australian National University","China (Country)","asian economic development","military spending","regional security","John Lee","Paul Dibb","Strategic \u0026 Defence Studies Centre","China's weakness","People’s Liberation Army","PLA","china vs US","Incomplete Superpower","Defence White Paper"],"channelId":"UCxzvNYT-17mjYJMuDzGx7AA","isOwnerViewing":false,"shortDescription":"Public Lecture by Emeritus Professor Paul Dibb and Adjunct Associate Professor John Lee.\n\nThe belief that China will soon become the dominant power in Asia is based on assumptions that its continued and rapid economic rise, and its emergence as a regional peer of America’s in military terms is all but assured. Such a belief underpins arguments that a fundamental strategic reorganisation of Asia is inevitable, and that it will be necessary and perhaps even desirable to concede to China significant ‘strategic space’. Dependent largely on linear extrapolations about the future, such arguments ignore the implications of China’s economic, social and national fragilities, its lack of major friends or allies in the region as well as the considerable military deficiencies and challenges faced by the People’s Liberation Army. With the Defence White Paper due for release in 2015, the government should bear in mind that planning for an era of Chinese dominance in the region—or even its emergence as an American strategic peer in Asia—would be premature if not improbable. Australia should not design its defence force for war with China, but it should be able to counter Chinese coercion and contribute to Allied military operations if necessary.\n\nPaul Dibb is Emeritus Professor of Strategic Studies in the Strategic \u0026 Defence Studies Centre, Coral Bell schol of Asia-Pacific Affairs, ANU. He was head of the Strategic and Defence Studies Centre from 1991 to 2004. Before that he held the positions of deputy secretary for Defence, director of the Joint Intelligence Organisation and head of the National Assessments Staff. He studied the former Soviet Union for over 20 years both as a senior intelligence officer and academic. He advised ASIO on certain Soviet activities. His book The Soviet Union--the Incomplete Superpower was published by the International Institute for Strategic Studies , London in 1986, reprinted 1987 and second edition 1988.\n\nJohn Lee is an Australian academic working on international economic and security affairs with a focus on the Asia-Pacific. Lee is an adjunct associate professor at the Australian National University's Strategic and Defence Studies Centre, a Michael Hintze Fellow at the Centre for International Security Studies, University of Sydney and a senior scholar at the Hudson Institute in Washington, DC. Lee is a board member of the Institute for Regional Security.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/_AvNT3vyzr0/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDjVRYrDEoXvuPzHs3611Y2jZr1gA","width":168,"height":94},{"url":"https://i.ytimg.com/vi/_AvNT3vyzr0/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBiluJk7wKjeB8fZ7YqSaQpFKUhKg","width":196,"height":110},{"url":"https://i.ytimg.com/vi/_AvNT3vyzr0/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDfSjOVJ2AHQl5lqUAtNqhjm4Q8LA","width":246,"height":138},{"url":"https://i.ytimg.com/vi/_AvNT3vyzr0/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLBx5p61RwfYjR94Wm4G c":"https://i9.ytimg.com/sb/_AvNT3vyzr0/storyboard3_L$L/$N.jpg?sqp=-oaymwECSEGi85f_AwYIlemC1AU=|48#27#100#10#10#0#default#rs$AOn4CLC3ayhqmPXQsYDoWXQOGTrC9xCAdA|80#45#429#10#10#10000#M$M#rs$AOn4CLBSnPpz6TX2GprnCwLe2c9yyUFEuA|160#90#429#5#5#10000#M$M#rs$AOn4CLDZlctU3WeOFhrspVkBGHscTqUdnw"}},"microformat":{"playerMicroformatRenderer":{"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/_AvNT3vyzr0/hqdefault.jpg","width":480,"height":360}]},"embed":{"iframeUrl":"https://www.youtube.com/embed/_AvNT3vyzr0","flashUrl":"http://www.youtube.com/v/_AvNT3vyzr0?version=3\u0026autohide=1","width":1280,"height":720,"flashSecureUrl":"https://www.youtube.com/v/_AvNT3vyzr0?version=3\u0026autohide=1"},"title":{"simpleText":"Why China Will Not Become the Dominant Power in Asia"},"description":{"simpleText":"Public Lecture by Emeritus Professor Paul Dibb and Adjunct Associate Professor John Lee.\n\nThe belief that China will soon become the dominant power in Asia is based on assumptions that its continued and rapid economic rise, and its emergence as a regional peer of America’s in military terms is all but assured. Such a belief underpins arguments that a fundamental strategic reorganisation of Asia is inevitable, and that it will be necessary and perhaps even desirable to concede to China significant ‘strategic space’. Dependent largely on linear extrapolations about the future, such arguments ignore the implications of China’s economic, social and national fragilities, its lack of major friends or allies in the region as well as the considerable military deficiencies and challenges faced by the People’s Liberation Army. With the Defence White Paper due for release in 2015, the government should bear in mind that planning for an era of Chinese dominance in the region—or even its emergence as an American strategic peer in Asia—would be premature if not improbable. Australia should not design its defence force for war with China, but it should be able to counter Chinese coercion and contribute to Allied military operations if necessary.\n\nPaul Dibb is Emeritus Professor of Strategic Studies in the Strategic \u0026 Defence Studies Centre, Coral Bell schol of Asia-Pacific Affairs, ANU. He was head of the Strategic and Defence Studies Centre from 1991 to 2004. Before that he held the positions of deputy secretary for Defence, director of the Joint Intelligence Organisation and head of the National Assessments Staff. He studied the former Soviet Union for over 20 years both as a senior intelligence officer and academic. He advised ASIO on certain Soviet activities. His book The Soviet Union--the Incomplete Superpower was published by the International Institute for Strategic Studies , London in 1986, reprinted 1987 and second edition 1988.\n\nJohn Lee is an Australian academic working on international economic and security affairs with a focus on the Asia-Pacific. Lee is an adjunct associate professor at the Australian National University's Strategic and Defence Studies Centre, a Michael Hintze Fellow at the Centre for International Security Studies, University of Sydney and a senior scholar at the Hudson Institute in Washington, DC. Lee is a board member of the Institute for Regional Security."},"lengthSeconds":"4280","ownerProfileUrl":"http://www.youtube.com/user/ANUchannel","externalChannelId":"UCxzvNYT-17mjYJMuDzGx7AA","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","
